import React, { Component } from "react";
import { connect } from "react-redux";
import { routes } from "../Router";
import { push, replace, goBack } from "connected-react-router";




class TripsDetails extends Component {

  

  render(){
    return (
      <div>
        <h1>details</h1>
        <button onClick={goToCreateTrip}>Cadastrar Trip</button>
        <button >Aprovar</button>



      </div>
    );
  }
}

const mapDispatchToProps = dispatch => ({
  goToCreateTrip: () => dispatch(push(routes.createTrip)),
  goTo: () => dispatch(push(routes.createTrip)),

});



export default connect(null, mapDispatchToProps)(TripsDetails);
